webpackJsonp([0xe798b9a53fdc],{527:function(e,n){e.exports={pathContext:{docHtml:'<h1>Contributing</h1>\n<h2>Report a Bug</h2>\n<p>Open an issue. Please include descriptions of the following:</p>\n<ul>\n<li>Observations</li>\n<li>Expectations</li>\n<li>Steps to reproduce</li>\n</ul>\n<h2>Contribute a Bug Fix</h2>\n<ul>\n<li>Report the bug first</li>\n<li>Create a pull request for the fix</li>\n</ul>\n<h2>Suggest a New Feature</h2>\n<ul>\n<li>Create a new issue to start a discussion around new topic. Label the issue as <code>new-feature</code></li>\n</ul>\n<h2>Setup your DEV environment</h2>\n<h3>Requirements</h3>\n<ul>\n<li>Golang 1.10</li>\n<li>Docker</li>\n<li>dep</li>\n</ul>\n<h3>Quickstart</h3>\n<p>See the <a href="./docs/quickstart.html">quickstart guide</a> for help in getting started.</p>\n<h2>Changing Types</h2>\n<p>If you\'re making a change to the <code>pkg/apis/sensor/v1alpha1</code> package, please ensure you re-run the K8 code-generator scripts found in the <code>/hack</code> folder. First, ensure you have the <code>generate-groups.sh</code> script at the path: <code>vendor/k8s.io/code-generator/</code>. Next run the following commands in order:</p>\n<pre><code>$ make codegen\n</code></pre>',docPath:"argo-events/contributing",proj:"argo-events"}}}});
